const FormElement = ({ id, label, type, value, handleChange }) => {
    if (type === "submit") {
        return (
            <>
                <input type={type}/>
            </>
        )
    } else {
        return (
            <>
                <label htmlFor={id}>{label}</label>
                <input id={id} type={type} value={value} onChange={handleChange} />
            </>
        )
    }
}

export default FormElement
